import React from 'react';
import setDisplay from './SetDisplay'

const ButtonNumber = ({number}) => {

    setDisplay.setDisplay = ({number}) => {};

    return(
    <button onClick={setDisplay}>{number}</button>
    );
};

export default ButtonNumber;

